#Returns three arrays: time, sep_list, omega_list from BH_diagnostics files
#TODO: read omega_list
def DatReader(output_glob):
  fileglob = os.path.join(output_glob, "puncturetracker-pt_loc..asc")
  # get columns to read
  with open(glob.glob(fileglob)[0]) as fh:
    for line in fh:
       # CapretIOASCII files have a header like this:
       # column format: 1:it   2:time  3:data
       # data columns: 3:pt_loc_t[0] 4:pt_loc_t[1] ...
      if line.startswith("# data columns:"):
        cols = dict([col.split(":")[::-1] for col in line.split()[3:]])
        break
  col_t = 1
  col_x0 = int(cols["pt_loc_x[0]"])-1
  col_y0 = int(cols["pt_loc_y[0]"])-1
  col_z0 = int(cols["pt_loc_z[0]"])-1
  col_x1 = int(cols["pt_loc_x[1]"])-1
  col_y1 = int(cols["pt_loc_y[1]"])-1
  col_z1 = int(cols["pt_loc_z[1]"])-1

  data = np.concatenate([np.loadtxt(f,ndmin=2) for f in sorted(glob.glob(fileglob))])
  #sort by time and extract shared times in the ugliest way possible
  data = data[data[:,col_t].argsort()]

  t = data[:,col_t]
  iX1 = np.column_stack((data[:,col_x0],data[:,col_y0],data[:,col_z0]))
  iX2 = np.column_stack((data[:,col_x1],data[:,col_y1],data[:,col_z1]))
  iX = iX1 - iX2
  iV = np.column_stack([np.gradient(iX[:,i], t, axis=0) for i in range(3)])
  rsep = np.zeros(len(iV))
  omega_norm = np.zeros(len(iV))

  for i in range(0,len(iV)):
    rsep[i] = np.linalg.norm(iX[i]) #calculate orbital radius
    omega_norm[i] = np.linalg.norm(np.cross(iX[i],iV[:][i]/(rsep[i]*rsep[i]))) #calculate orbital frequency
  rsep = np.column_stack((t[np.isfinite(rsep)],rsep[np.isfinite(rsep)]))
  omega_norm = np.column_stack((t[np.isfinite(omega_norm)],omega_norm[np.isfinite(omega_norm)]))
  return rsep, omega_norm

#Formulas for lambda_t, pr, pt, px, py
def delta_rmas(Amp, R_0, omega_0, q, gamma):
  return (Amp*R_0/(2.*omega_0)) - (3.*Amp*gamma*(3 + 7*q + 3*(q**2))/(4.*omega_0*(1.+q)**2.))
def lambda_t1PNLin(ecc, sign, R_0, eta):
  return 1 + (sign*np.abs(ecc)/2.) + (sign*np.abs(ecc)*((-1./R_0) - (eta/(2*R_0))))
def pr(x, y, Px, Py):
  return (Px*x + Py*y)/np.sqrt(x**2 + y**2)
def p_theta(x, y, Px, Py):
  return (x*Py) - (y*Px)
def pt(x, y, Px, Py):
  return ((x*Py) - (y*Px))/np.sqrt(x**2 + y**2)
def Px(x, y, Pr, Pt):
  return -((Pt*y) - (Pr*x))/np.sqrt(x**2 + y**2)
def Py(x, y, Pr, Pt):
  return (Pt*x + Pr*y)/np.sqrt(x**2 + y**2)
def PxPyToPrPt(x, y, Px, Py):
  #return Pr,Pt
  return pr(x, y, Px, Py), pt(x, y, Px, Py)
def PrPtToPxPy(x, y, Pr, Pt):
  #return Px,Py
  return Px(x, y, Pr, Pt), Py(x, y, Pr, Pt)
def lambda_r1PNResSum(Amp, phi, Pr_0, omega_0, R_0, eta, gamma):
  return 1 + (Amp*eta*np.tan(phi)*np.sqrt(np.cos(phi)**2)/(2.*np.sqrt(R_0)*omega_0*np.abs(Pr_0))) + (Amp*gamma*eta*np.tan(phi)*np.sqrt(np.cos(phi)**2)/(2.*(R_0**1.5)*omega_0*np.abs(Pr_0)))
def lambda_t1PNResSum(Amp, phi, omega_0, R_0, eta, gamma):
  return 1 + (Amp*np.sqrt(np.cos(phi)**2)/(4.*omega_0)) - (Amp*gamma*(1. + 3.*eta)*np.sqrt(np.cos(phi)**2)/(8.*R_0*omega_0))

