# 1PN merger time for **circular** orbits Blanchet, arXiv:1310.1528) Eqs.
# 230,315,316.
# here "r==separation" since the origianal seperation is the "radius" in the
# effective one body system in which one operates.
def tCoal0PN(eta, total_mass, separation):
  return 5./256. * separation**4 / (eta*total_mass**2)

#Fitting Function
#TODO: fix radial separation convention and remove extra parameter
def myEstimateEccentricityReductionPN35D10DE(eta, chi_1, chi_2, intrad, int_Omega, MinTime=200, MaxTime=900, fit_plot_filename=None):
  """
  intrad,int_Omega = 2col numpy array
  chi_1, chi_2 = 3-tuples
  fit_plot_filename = name of file to store plot of fitted function in
  """
  q = (1 + np.sqrt(1 - 4*eta) - 2*eta)/(2*eta)
  # MaxTime = np.min([MaxTime,intrad[0,-1]])
  #TODO: check D0 convention
  D0 = intrad[0,1] #first radius in r data
  # this assumes total_mass = 1, it cannot tell which mass is larger but tCoal
  # does not care anyway
  MAXTime = tCoal0PN(eta=eta, total_mass=1., separation=D0)

  Omega_0 = m_omega_r35SPN(D0,q,chi_1,chi_2,1.) if m_omega_r35SPN(D0,q,chi_1,chi_2,1.) > 10e-6 else 0 #chop
  omega_data = int_Omega[(int_Omega[:,0]>=MinTime)*(int_Omega[:,0]<=MaxTime)]

  s1z = chi_1[2]
  s2z = chi_2[2]

  popt1,pcov1 = sp.optimize.curve_fit(make_ansatz1(eta, s1z, s2z, MAXTime),omega_data[:,0],omega_data[:,1])
  a,t_0 = popt1

  # first fit only for e and phase offset t_1
  popt2a,pcov2a = sp.optimize.curve_fit(
     make_ansatz2a(eta, s1z, s2z, MAXTime, Omega_0, a, t_0, omega_1=1., ke=0., k_omega=0.),
     omega_data[:,0],omega_data[:,1],
       #  e        t_1
     p0=[1e-2,  -np.pi],
bounds=([1e-5,-2*np.pi],
        [5e-2,+2*np.pi]))
  e,t_1 = popt2a

  # # Fitting with ansatz1 params not fixed
  popt2,pcov2 = sp.optimize.curve_fit(
     make_ansatz2(eta, s1z, s2z, MAXTime, Omega_0),
     omega_data[:,0],omega_data[:,1],
     #      e   a  t_0  om1      t_1  k_e k_om
     p0=[   e,  a, t_0, 1.0,     t_1,  0.,  0.],
bounds=([1e-5,0.5,-5.0,-5.0,-2*np.pi,-10.,-10.],
        [5e-2,3.0,+5.0,+5.0,+2*np.pi,+10.,+10.]))
  e,a,t_0,omega_1,t_1,ke,k_omega = popt2
  perr = np.sqrt(np.diag(pcov2))
  delta_e = perr[0]
  delta_ke = perr[5]
  delta_t_1 = perr[4]

  t = 0.
  amp = e*(1-.0001*ke*t)
  delta_amp = delta_e*np.abs(1 - .0001*ke*t) + np.abs(e*-.0001*t)*delta_ke
  e_Omega = .5*amp/Omega_0
  delta_e_Omega = .5*delta_amp/Omega_0

  if fit_plot_filename:
    import matplotlib
    matplotlib.use("pdf")
    from matplotlib.backends.backend_pdf import PdfPages
    import matplotlib.pyplot as plt
    with PdfPages(fit_plot_filename) as pdf:
      omega_data_extended = np.array([p for p in int_Omega if (p[0]>=0.9*MinTime) and (p[0]<=1.1*MaxTime)])

      # fig plot for whole fit including ansatz1
      plt.plot(omega_data_extended[:,0], omega_data_extended[:,1], label="data")
      plt.plot(omega_data_extended[:,0], make_ansatz1(eta, s1z, s2z, MAXTime)(omega_data_extended[:,0], *popt1), linestyle="dashed", label="first ansatz")
      plt.plot(omega_data_extended[:,0], make_ansatz2(eta, s1z, s2z, MAXTime, Omega_0)(omega_data_extended[:,0], *popt2), linestyle="dashed", label="second ansatz")
      plt.legend()
      msg = "ecc estimate: %g +/- %g" % (e_Omega, delta_e_Omega)
      plt.text(0.02,0.75, msg, transform=plt.gca().transAxes, va="bottom")
      if(verbose):
        msg = "e = %.3g, a = %.3g, t_0 = %.3g, omega_1 = %.3g,\nt_1 = %.3g, ke = %.3g, k_omega = %.3g\n" % (e,a,t_0,omega_1,t_1,ke,k_omega)
        msg += "cov =\n" + np.array_str(pcov2, precision=1)
        plt.text(0.02,0.75, msg, transform=plt.gca().transAxes, fontsize=6, family="monospace", va="top")
      pdf.savefig()
      plt.close()
      # fig plot for ansatz2 only
      plt.plot(omega_data_extended[:,0], omega_data_extended[:,1]/make_ansatz1(eta, s1z, s2z, MAXTime)(omega_data_extended[:,0], *popt1), label="data  / first ansatz")
      plt.plot(omega_data_extended[:,0], make_ansatz2(eta, s1z, s2z, MAXTime, Omega_0)(omega_data_extended[:,0], *popt2)/make_ansatz1(eta, s1z, s2z, MAXTime)(omega_data_extended[:,0], *popt1), linestyle="dashed", label="second ansatz / first ansatz")
      plt.legend()
      msg = "ecc estimate: %g +/- %g" % (e_Omega, delta_e_Omega)
      plt.text(0.02,0.75, msg, transform=plt.gca().transAxes, va="bottom")
      if(verbose):
        msg = "e = %.3g, a = %.3g, t_0 = %.3g, omega_1 = %.3g,\nt_1 = %.3g, ke = %.3g, k_omega = %.3g\n" % (e,a,t_0,omega_1,t_1,ke,k_omega)
        msg += "cov =\n" + np.array_str(pcov2, precision=1)
        plt.text(0.02,0.75, msg, transform=plt.gca().transAxes, fontsize=6, family="monospace", va="top")
      pdf.savefig()
      plt.close()

  return e_Omega, delta_e_Omega, t_1, delta_t_1, amp, delta_amp

